package com.company;import java.util.Arrays;import java.util.List;import java.util.Scanner;import java.util.stream.Collectors;public class ListManipulationBasics_04 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        List<Integer> numbers = Arrays.stream(scanner.nextLine().split(" "))                .map(Integer::parseInt).collect(Collectors.toList());                String command = scanner.nextLine();        while (!command.equals("end")){            String[] currentCommand = command.split(" ");            switch (currentCommand[0]) {                case "Add" -> {                    int addToNumberInLists = Integer.parseInt(currentCommand[1]);                    numbers.add(addToNumberInLists);                }                case "Remove" -> {                    int removeNumberFromLists = Integer.parseInt(currentCommand[1]);                    numbers.remove(Integer.valueOf(removeNumberFromLists));                }                case "RemoveAt" -> {                    int removeIndexFromLists = Integer.parseInt(currentCommand[1]);                    numbers.remove(removeIndexFromLists);                }                case "Insert" -> {                    int insertNumber = Integer.parseInt(currentCommand[1]);                    int insertIndex = Integer.parseInt(currentCommand[2]);                    numbers.add(insertIndex, insertNumber);                }            }            command = scanner.nextLine();        }        for (Integer number : numbers) {            System.out.print(number + " ");        }    }}